TileSet *DFont_Load()
{
    // If we are already loaded, just return a ptr to the tileset.
    if(IsLoaded)
    {
        return &DFontTileSet;
    }

    TileSet_Init(&DFontTileSet);

    // Clear color.
    SDL_Surface *surf = LoadSurfaceFromColor(DF_IMG_WIDTH, DF_IMG_HEIGHT, 0, 0, 0, 0);

    // Loop thru the image and set every non-zero pixel to white.
    u32 i = 0;
    for(u32 y = 0; y < DF_IMG_HEIGHT; y++)
    {
        for(u32 x = 0; x < DF_IMG_WIDTH; x++)
        {
            if(Pixels[i++] > 0)
            {
                SetImagePixel(surf, x, y, 255, 255, 255, 255);
            }
            else
            {
                SetImagePixel(surf, x, y, 0, 0, 0, 0);
            }
        }
    }

    // Create a texture from our image.
    SDL_Texture *tex = LoadTextureFromSurface(surf);

    // Free the surface, we no longer need it.
    SDL_FreeSurface(surf);

    // Load up the tile map from our texture.
    TileSet_LoadSpriteSheetTexture(&DFontTileSet, tex, DF_COLS, DF_ROWS, DF_CHAR_WIDTH, DF_CHAR_HEIGHT, 1);

    // Flag that we are loaded.
    IsLoaded = true;

    // Return a ptr to the tile map.
    return &DFontTileSet;
}

TileSet *DFont_GetPtr()
{
    if(!IsLoaded)
    {
        return NULL;
    }
    return &DFontTileSet;
}

